pragma solidity >=0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "solady/src/utils/SSTORE2.sol";
import "./Sculpture.sol";

contract Essay is Sculpture, Ownable {

    address private pointer1;
    address private pointer2;
    string private t;
    string private a = "maltefr";
    string[] private u;

    constructor () Ownable(msg.sender) {}

    function title() external view returns (string memory) {
        return t;
    }

    function authors() public view returns (string[] memory authors_) {
        authors_ = new string[](1);
        authors_[0] = a;
        return authors_;
    }

    function addresses() external view returns (address[] memory) {
        address[] memory _addresses = new address[](1);
        _addresses[0] = address(this);
        return _addresses;
    }

    function urls() external view returns (string[] memory) {
        return u;
    }

    function text() external view returns (string memory) {
        if (pointer1 == address(0)) {
            return "";
        }
        return string.concat(
            string(SSTORE2.read(pointer1)),
            pointer2 == address(0) ? "" : string(SSTORE2.read(pointer2))
        );
    }

    function setTitle(string memory _title) external onlyOwner {
        t = _title;
    }

    function setAuthor(string memory _author) external onlyOwner {
        a = _author;
    }

    function setUrls(string[] memory _urls) external onlyOwner {
        u = _urls;
    }

    function setTextPt1(string memory _text) external onlyOwner {
        pointer1 = SSTORE2.write(bytes(_text));
    }

    function setTextPt2(string memory _text) external onlyOwner {
        pointer2 = SSTORE2.write(bytes(_text));
    }

    function html() external view returns (string memory html) {
        html = string.concat(
            "<h1>", t, "</h1>",
            "<br><br><br>",
            "<h2><i>Written by ", authors()[0], "</i></h2>",
            "<br><br>",
            "<div>",
                pointer1 == address(0)
                    ? ""
                    : string.concat(
                        string(SSTORE2.read(pointer1)),
                        pointer2 == address(0) ? "" : string(SSTORE2.read(pointer2))
                    ),
            "</div>");
    }
}","keccak256":"0x73f2128cdc1bc4a489875abfe3354aeec8ddfc23000871b8211aa9ba2b2042c0","license":"MIT"},"contracts/GardenContributions.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0;

import "solady/src/utils/LibString.sol";
import "./IGarden.sol";
import "./Sculpture.sol";

library GardenContributions {
    function html(address garden) external view returns (string memory html) {
        uint256 guests = IGarden(garden).guests();
        uint256 flowers = IGarden(garden).flowers();
        html = string.concat(html,
            '<div class="w"><div class="s">',
                '<div id="field1" class="field"></div>'
                '<br><br><br>',
                '<p style="text-align:center;">',
                'Guestbook',
                '<br><br>',
                'You may leave a flower here by sending 0.01 ETH (or multiples thereof)<br> to the show contract at <span class="a">',
                    LibString.toHexStringChecksummed(garden),
                '</span><br><br>',
                LibString.toString(guests),
                guests == 1 ? ' guest has' : ' guests have',
                ' planted ', LibString.toString(flowers),
                ' flower' , flowers == 1 ? '' : 's',
                '</p><br><br><br>',
                '<div id="field2" class="field"></div>',
                '<style>'
                    '.tooltip { font-size: 0.8em; background: white; border: 1px solid black; padding: 0.5em; width: 220px; }',
                    '.tooltip.r { text-align: right; }',
                    '.tooltip .address { overflow-wrap: break-word; }',
                '</style>',
                '<script>',
                    'document.addEventListener("DOMContentLoaded", () => {',
                    'const flowers = ', LibString.toString(IGarden(garden).flowers()), ';',
                    unicode'console.log(`Welcome to the ', Sculpture(garden).title(), '`);',
                    unicode'console.log(` ⚘                    ⚘                  ⚘\n',
                    unicode'             ⚘                       ⚘\n',
                    unicode'    ⚘\n',
                    unicode'                      ⚘                     ⚘\n\n',
                    unicode'    Initializing garden with ${flowers} flowers\n\n',
                    unicode'             ⚘                         ⚘\n',
                    unicode'⚘                        ⚘                   ⚘\n',
                    unicode'    ⚘                                ⚘\n',
                    unicode'                      ⚘`);',
                    'function calculateThreshold(planted) {',
                        'const min = 30, max = 10000, lower = 0.99, higher = 0.8;',
                        'if (planted <= min) return lower;',
                        'if (planted >= max) return higher;',
                        'const normalized = (planted - min) / (max - min);',
                        'const logValue = Math.log10(1 + normalized * (10 - 1));',
                        'return higher + (lower - higher) * (1 - logValue);',
                    '}',
                    'function isConditionMet(planted, val) {',
                        'const threshold = calculateThreshold(planted);',
                        'return val > threshold || val < -threshold;',
                    '}',
                    'function gridNoise(x, z, seed) {',
                        'var n = (1619 * x + 31337 * z + 1013 * seed) & 0x7fffffff;',
                        'n = BigInt((n >> 13) ^ n);',
                        'n = n * (n * n * 60493n + 19990303n) + 1376312589n;',
                        'n = parseInt(n.toString(2).slice(-31), 2);',
                        'return 1 - n / 1073741824;',
                    '}',
                    'const width = 90;',
                    'let lines = [""], counter = 0, planted = 0;',
                    'while (planted < flowers) {',
                        'const val = gridNoise(counter % width, Math.floor(counter / width), 0xf);',
                        'const threshold = calculateThreshold(planted);',
                        'if (val > threshold || val < -threshold) {',
                            unicode'lines[Math.floor(counter / width)] += `<a href="#${planted+1}" id="flower-${planted+1}" style="position:relative;" data-flower-id="${planted+1}">⚘</a>`;',
                            'planted++;',
                        '} else { lines[Math.floor(counter / width)] += " "; }',
                        'if (counter % width == (width-1) && planted < flowers) { lines.push(""); }',
                        'counter++;'
                    '}',
                    'lines = lines.reduce((acc, line) => { if (line.trim().length > 0) acc.push(line); return acc; }, []);',
                    'document.querySelector("#field1").innerHTML = lines.slice(0,Math.min(7,Math.ceil(lines.length/2))).join("\\n");',
                    'document.querySelector("#field2").innerHTML = lines.slice(Math.min(7,Math.ceil(lines.length/2))).join("\\n");',
                    'const flowerEls = document.querySelectorAll(".field a");',
                    'flowerEls.forEach((el) => {',
                        'el.addEventListener("mouseenter", (e) => {',
                        'const flowerId = e.target.dataset.flowerId;',
                        'if (flowerId) {',
                            'e.preventDefault();'
                            'showTooltip(flowerId);',
                        '}',
                    '});',
                    'el.addEventListener("mouseleave", (e) => {',
                    '    document.querySelectorAll(".tooltip").forEach((el) => el.remove());',
                    '});',
                    '});'
                    'window.addEventListener("resize", () => document.querySelectorAll(".tooltip").forEach((el) => el.remove()));',
                    'document.querySelectorAll(".field").forEach((el) => el.addEventListener("scroll", () => document.querySelectorAll(".tooltip").forEach((el) => el.remove())));',
                    'function showTooltip(flowerId) {',
                        'document.querySelectorAll(".tooltip").forEach((el) => el.remove());',
                        'const tooltip = document.createElement("div");',
                        'tooltip.classList.add("tooltip");',
                        'tooltip.id = "tooltip" + flowerId;',
                        'tooltip.innerHTML = `Loading Flower #${flowerId} ...`;',
                        'tooltip.style.position = "absolute";',
                        'const flower = document.getElementById("flower-" + flowerId);',
                        'const clientRect = flower.getBoundingClientRect();',
                        'const offsetTop = window.pageYOffset || document.documentElement.scrollTop || document.body.scrollTop || 0;',
                        'tooltip.style.top = clientRect.top + (offsetTop) + flower.clientHeight + "px";',
                        'const offsetLeft = window.pageXOffset || document.documentElement.scrollLeft || document.body.scrollLeft || 0;',
                        'const leftPos = clientRect.left + offsetLeft;',
                        'tooltip.style.left = leftPos > window.innerWidth - 250 ? leftPos - 220 + "px" : leftPos + "px";',
                        'if (leftPos > window.innerWidth - 250) tooltip.classList.add("r");',
                        'document.body.appendChild(tooltip);',
                        'loadFlower(flowerId);',
                    '}',
                    'const fetchFlowerMemo = (() => {',
                    '    const cache = {};',
                    '    return async function(flowerId) {',
                    '        if (cache[flowerId]) return { ...cache[flowerId] };',
                    '        const res = await fetch("/flower/" + flowerId);',
                    '        const data = await res.json();',
                    '        cache[flowerId] = { ...data };',
                    '        return data;',
                    '    }',
                    '})();',
                    'async function loadFlower(flowerId) {',
                    '    try {',
                    '        const data = await fetchFlowerMemo(flowerId);',
                    '        console.log(`Loaded Flower #${flowerId}`, data);',
                    '        const tooltip = document.getElementById("tooltip" + flowerId);',
                    '        if (!tooltip) return;',
                    unicode'        tooltip.innerHTML = `Flower #${flowerId}<br> <span class="address">${data.planter}</span><br> ${formatTime(data.timestamp)}`;',
                    '    } catch (e) {',
                    '         console.error("Error loading flower", e);',
                    '    }',
                    '}',
                    'function formatTime(t) {',
                    '    const date = new Date(t * 1000);',
                    '    const options = { month: "long" };',
                    '    const month = new Intl.DateTimeFormat("en-US", options).format(date);',
                    '    const day = date.getDate();',
                    '    const year = date.getFullYear();',
                    '    let hours = date.getHours();',
                    '    const minutes = date.getMinutes().toString().padStart(2, "0");',
                    '    const amPm = hours >= 12 ? "pm" : "am";',
                    '    hours = hours % 12 || 12;',
                    '    return `${month} ${day}, ${year}, ${hours}:${minutes}${amPm}`;',
                    '}',
                    '});',
                '</script>',
            '</div></div>'
        );
    }
}","keccak256":"0x62d2ce0608f79e34b19c65775dc33b6236f7c1dff9758b6faca5bb4f00cc0564","license":"MIT"},"contracts/GardenHTML.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0;

library GardenHTML {
    function html(string memory body, string memory title, string memory description) external pure returns (string memory) {
        string memory html_ = '<!DOCTYPE html><html lang="en">';
        html_ = string.concat(html_,
            '<head><meta charset="UTF-8"><meta name="viewport" content="width=device-width, initial-scale=1.0">',
            '<link rel="icon" type="image/svg+xml" href="data:image/svg+xml,%3Csvg%20xmlns=', unicode"'http://www.w3.org/2000/svg'%20viewBox='0%200%20100%20100'%3E%3Cstyle%3E%20text%20%7B%20fill:%20%23000;%20%7D%20@media%20(prefers-color-scheme:%20dark)%20%7B%20text%20%7B%20fill:%20%23fff;%20%7D%20%7D%20%3C/style%3E%3Ctext%20y='.9em'%20font-size='90'%3E%20⚘%20%3C/text%3E%3C/svg%3E%0A",'">',
            '<title>', title ,'</title>',
            "<meta name='description' content='", description, "'>",
            '<style>',
            '*, *::before, *::after { box-sizing: border-box; }',
            'html { -moz-text-size-adjust: none; -webkit-text-size-adjust: none; text-size-adjust: none; } html, body { margin: 0; padding: 0; } body { min-height: 100vh } html,body,pre { font-family: "Courier New", "Courier", monospace; font-size: 15px; line-height: 1.3; }',
            'h1,h2,h3 { margin: 0; font-size: inherit; font-style: inherit; font-weight: inherit;}',
            '.c { max-width: 860px; margin: 0 auto; padding: 0 20px; box-sizing: border-box; }',
            '.c.essay { max-width: 620px; }',
            'a { color: inherit; text-decoration: underline; }',
            '.w { position: relative; min-height: 100vh; display: flex; align-items: center; padding: 10em 0; }',
            '.s { width: 100%; max-width: 860px; }',
            '.s:not(.g) a { max-width: 100%; display: inline-block; white-space: nowrap; overflow: hidden; text-overflow: ellipsis; }',
            '.t { max-width: 100%; overflow-x: auto; margin: 1em 0; }',
            '.i { margin: 0 0 5em; }',
            '.f { position: fixed; bottom: 1em; right: 1.3em; }',
            '.p { position: absolute; bottom: 2rem; left: 50%; transform: translateX(-50%); font-size: 1.4em; }',
            '.field { white-space: pre; margin: 0 auto; max-width: 100%; overflow-x: auto; }',
            '.field a { text-decoration: none; }',
            '.a { overflow: hidden; display: inline-block; max-width: 100%; text-overflow: ellipsis; vertical-align: middle; ',
            '</style>',
            '</head>'
        );
        html_ = string.concat(html_, '<body>', body, '</body></html>');
        return html_;
    }
}","keccak256":"0xa3731167c22101040456d9985b5965d296f5a521681c402914360a34472438ea","license":"MIT"},"contracts/GardenIndex.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0;

import "solady/src/utils/LibString.sol";
import "./GardenHTML.sol";
import "./GardenContributions.sol";
import "./lib/Format.sol";
import "./Essay.sol";
import "./IGarden.sol";
import "./Sculpture.sol";
import "./Mod.sol";

library GardenIndex {
    function html(address garden, address essayContract, address data) public view returns (string memory html) {
        address[] memory sculptures = IGarden(garden).getSculptures();

        // Header
        html = string.concat(html,
            '<div class="c">',
            '<div class="w">',
            '<div class="s g">',
            '<pre class="garden">',
            unicode"       ⚘                    ⚘\n",
            unicode"             ⚘\n",
            unicode"⚘                       ⚘         ⚘\n",
            unicode"        ⚘         ⚘\n",
            unicode"   ⚘                          ⚘\n",
            unicode"</pre>",
            '<br><br>',
            unicode"<h1>", Sculpture(garden).title(), "</h1>\n",
            '<br><br>'
        );

        // Artist names
        for (uint256 i = 0; i < sculptures.length; i++) {
            try Sculpture(sculptures[i]).authors() returns (string[] memory authors) {
                for (uint256 j = 0; j < authors.length; j++) {
                    if (bytes(authors[j]).length == 0) continue; // ignore empty
                    html = string.concat(html, authors[j], "<br>");
                }
            } catch {
                html = string.concat(html, "Unkown<br>");
            }
        }

        // Header End
        html = string.concat(html,
            '<br><br>',
            '<h2 class="a">', LibString.toHexStringChecksummed(garden), '</h2><br><br>',
            '<pre class="garden">',
            unicode'      ⚘                      ⚘\n',
            unicode'              ⚘\n',
            unicode' ⚘                     ⚘         ⚘\n',
            unicode'          ⚘      ⚘\n',
            unicode'     ⚘                     ⚘\n',
            unicode'</pre><br>',
            '<p>',
            'A contract show curated by ',
            '<a href="', Mod(data).fffUrl() ,'" target="_blank" rel="noopener noreferrer">', Mod(data).fff(), '</a><br>',
            'with special thanks to ',
            '<a href="', Mod(data).lukeUrl(), '" target="_blank" rel="noopener noreferrer">', Mod(data).luke() ,'</a> and ',
            '<a href="', Mod(data).oneOneThreeUrl(), '" rel="noopener noreferrer" target="_blank">', Mod(data).oneOneThree(),'</a>',
            '<br><br>',
            '<a href="/essay">', Sculpture(essayContract).title() ,'</a> by <a href="', Mod(data).malteUrl(), '" target="_blank" rel="noopener noreferrer">', Mod(data).malte() ,'</a>',
            '</p><br><br>'
        );

        // Scroll Indicator
        html = string.concat(
            html,
            '<br></div>',
            unicode'<div class="p">↓</div></div>'
        );

        // Text
        html = string.concat(html,
            '<div class="w"><div class="s">',
            Sculpture(garden).text(),
            '<br>',
            '<p>The website you are viewing was generated from the show contract itself at block ', LibString.toString(block.number) ,'. ',
            'Over time, as people engage with the artworks and artists activate their pieces, the information rendered here will change. Block by block. Year by year.</p>',
            '</div></div>'
        );

        // Sculptures
        for (uint256 i = 0; i < sculptures.length; i++) {
            Sculpture sculpture = Sculpture(sculptures[i]);

            html = string.concat(html, '<div class="w"><div class="s">');

            // Authors
            try sculpture.authors() returns (string[] memory authors) {
                if (authors.length > 0) {
                    html = string.concat(html, '<h2>');
                    for (uint256 j = 0; j < authors.length; j++) {
                        if (bytes(authors[j]).length == 0) continue; // ignore empty
                        html = string.concat(html, authors[j], '<br>');
                    }
                    html = string.concat(html, '</h2>');
                }
            } catch {
                html = string.concat(html, '<h2><i>Unkown</i></h2>');
            }

            // Title
            try sculpture.title() returns (string memory title) {
                if (bytes(title).length > 0) {
                    html = string.concat(html, '<h3><i>', title, '</i></h3>');
                } else {
                    html = string.concat(html, '<h3><i>Untitled</i></h3>');
                }
            } catch {
                html = string.concat(html, '<h3><i>Untitled</i></h3>');
            }

            // Addresses
            try sculpture.addresses() returns (address[] memory addresses) {
                if (addresses.length > 0) {
                    html = string.concat(html, '<p>');
                    for (uint256 j = 0; j < addresses.length; j++) {
                        html = string.concat(html, '<span class="a">', LibString.toHexStringChecksummed(addresses[j]), '</span><br>');
                    }
                    html = string.concat(html, '</p>');
                }
            } catch {
                html = string.concat(html, '<p><span class="a">', LibString.toHexStringChecksummed(sculptures[i]) , '</span></p>');
            }

            // Urls
            try sculpture.urls() returns (string[] memory urls) {
                if (urls.length > 0) {
                    html = string.concat(html, '<p>');
                    for (uint256 j = 0; j < urls.length; j++) {
                        if (bytes(urls[j]).length == 0) continue; // ignore empty
                        html = string.concat(html, Format.renderUrl(urls[j]), '<br>');
                    }
                    html = string.concat(html, '</p>');
                }
            } catch {
                // ignore reverting urls
            }

            // Text
            try sculpture.text() returns (string memory text) {
                if (bytes(text).length > 0) {
                    html = string.concat(html, '<div class="t">', text, '</div>');
                }
            } catch {
                html = string.concat(html, '<div class="t"><i>Contract Reverted</i></div>');
            }

            html = string.concat(html, '</div></div>');
        }

        // Contributions
        html = string.concat(html, GardenContributions.html(garden));

        // Footer
        html = string.concat(html, '<div class="i">Generated in block ', LibString.toString(block.number), ' from <span class="a">', LibString.toHexStringChecksummed(address(this)) ,"</span></div>");

        // End
        html = string.concat(html, '</div>');

        string memory description = string.concat('Contract Show: World Computer Sculpture Garden at ', LibString.toHexStringChecksummed(garden), '. Curated by ', Mod(data).fff(), '.');

        return GardenHTML.html(html, Sculpture(garden).title(), description);
    }
}","keccak256":"0x46e503dd8f57d45577f81f1a2c79d474a9663e5ebe49013ee0e9c4d71bcb2d13","license":"MIT"},"contracts/IGarden.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0;

interface IGarden {
    function getSculptures() external view returns (address[] memory);
    function flower(uint256 flowerId) external view returns (address);
    function flowers() external view returns (uint256);
    function flowersPlanted(address planter) external view returns (uint256);
